import React from "react";
import ReactDOM from 'react-dom';
import "../styles/Login.css";

class Login extends React.Component {
    constructor() {
        super();
        this.state = {
          expanded: true,
          activeKey: "1",
          visible: true
        };
        this.handleSelect = this.handleSelect.bind(this);
      }
      handleSelect(eventKey) {
        this.setState({
          activeKey: eventKey
        });
      }
      render() {
        return (
            <div id="title">

            </div>
        );
      }
}

export default Login;
